import { Outlet,  } from "react-router-dom";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from "react-bootstrap/Form";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import "bootstrap/dist/css/bootstrap.min.css";
import {} from '../img/Carouselstyle.css';
import Footer from '../components/Footer';



const Layout = () => {
  return (
    <>
      <Navbar  bg="light" expand="lg" className="header">
        <Container fluid>
          <Navbar.Brand href="/" className="textcolor">Granit Hashani</Navbar.Brand>
          <Navbar.Toggle aria-controls="navbarScroll" />
          <Navbar.Collapse id="navbarScroll">
            <Nav
              className="me-auto my-2 my-lg-0"
              style={{ maxHeight: "100px" }}
              navbarScroll
            >
              <Nav.Link href="/" className="textcolor">Home</Nav.Link>
              <Nav.Link href="/about" className="textcolor">About</Nav.Link>
              <Nav.Link href="/login" className="textcolor">Login</Nav.Link>
              <NavDropdown title="Disable" id="navbarScrollingDropdown" disabled className="textcolor">
                <NavDropdown.Item href="#action3" className="textcolor">Action</NavDropdown.Item>
                <NavDropdown.Item href="#action4">
                  Another action
                </NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action5">
                  Something else here
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Form className="d-flex">
              <Form.Control
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
              <Button variant="outline-success">Search</Button>
            </Form>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Outlet />
      <Footer />

      
    </>
  );
};

export default Layout;
